import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import PageHeader from './components/PageHeader/PageHeader';
import PageFooter from './components/PageFooter/PageFooter';

function App() {

  const routeComponents = [
    {index:0, path:"/", name:"IntroPage", component: <IntroPage/>},
    {index:1, path:"/QuestionsPage", name:"QuestionsPage", component: <QuestionsPage/>},
    {index:2, path:"/DatePage", name:"DatePage", component: <DatePage/>},
    {index:3, path:"/CompletionPage", name:"CompletionPage", component: <CompletionPage/>}
  ];


  return (
    <Router>
      <Container className='containerHeight'>
        <PageHeader components={routeComponents}/>
      </Container>
      <Container className='containerHeight'>
        <Row>
          <Col>
          </Col>
          <Col xs={12}>
            <Routes>
              {(() => {
                let routes = []
                for(var i=0; i < routeComponents.length; i++) {
                  routes.push(
                    <Route exact 
                    path={routeComponents[i].path} 
                    element= {routeComponents[i].component} />
                  )
                }
                return routes;
              })()}
            </Routes>
          </Col>
          <Col>
          </Col>
        </Row>
      </Container>
      <Container>
        <PageFooter pageCount={routeComponents.length} index={routeComponents.index}/>
      </Container>
    </Router>
  );
}

export default App;
